4,'','Can\'t change your job into something totally different.','x'),(6,15,'To make the 4th job advancement, you\'ll need to be at least at LV. 120, with a 3rd job adv. under your belt.','The 4th job adv. will be available to the ones over LV. 120.','o'),(6,16,'A 1st-level Magician skill, \"Improving MP Recovery,\" goes up to level 15.','The skill goes up to level 16.','x'),(6,100,'When the Spearman\'s skill, \"Hyper Body,\" is fully mastered, your MaxHP and MaxMP increases by 60%.','If you have mastered the skill, your MaxHP & MaxMP increases 60%.','o'),(6,101,'When the Sniper\'s skill, \"Iron Arrow,\" is fully mastered, the damage will increase by 180%.','Once you have mastered the Iron Arrow, the damage will increase by 180%.','o'),(6,102,'The Thief has a skill called \"Lucky Seven,\" which enables you to throw stars in mid-air.','Thieves can use skills while in mid-air.','o'),(6,103,'All 2nd-level skills, regardless of the occupation, has a total of 6 sets of skills.','There are 8 different sets of skills for Warriors.','x'),(6,104,'In order to become a Bowman, beginners need to head over to Bowman Training School.','The beginners can become thieves at the Thieves\' Hideout.','x'),(6,105,'Magicians have 3 different types of jobs available for the 4th job adv.','Only Warriors have the jobs split 3 ways for the 4th job adv.','x'),(6,106,'','','x'),(6,107,'','','x'),(6,108,'','','o'),(6,109,'Add up all the occupations for the 4th job adv., and it adds up to 9.','3 for Warriors + 2 for Magicians + 2 for bowmen + 2 for thieves = 9','o'),(6,110,'','','x'),(6,111,'','','o'),(6,112,'','','o'),(6,113,'','','x'),(6,114,'','','x'),(6,115,'','','x'),(7,1,'After making your new character, the first place you head over to is the [Maple Island].','[Maple Island] is the very first place you end up in MapleStory.','o'),(7,2,'When creating a character, you\'ll be rolling a dice for the character stats. When you add up the stats for STR, DEX, INT, LUK, it\'ll add up to 24.','It\'s a total of 25 points.','x'),(7,3,'The first NPC you run into in MapleStory is \"Rina.\"','The first NPC you run into in MapleStory is \"Heena.\"','x'),(7,4,'Beginners need to pay only 100 mesos, a major discount, to use the cabs that are placed on every town on the island.','Beginners only need to pay 50 mesos to use the cab.','x'),(7,5,'To purchase potions and scrolls at Kerning City, head over to \"Famous Pharmacy.\"','To purchase potions at Kerning City, head over to \"Famous Pharmacy.\"','o'),(7,6,'In a safe town, you won\'t die even if your HP runs out by dropping from a high place.','Even in a safe town, if the HP runs out, the character will die.','x'),(7,7,'To enter the Hidden Street, your character needs to be at least at LV. 10, with the job adv. under its belt.','Anyone can enter the Hidden Street.','x'),(7,8,'The VIP Sauna at the Sleepywood Hotel costs 999 mesos to enter.','The VIP Sauna costs 999 mesos to enter.','o'),(7,9,'To contact the MapleStory Hotline, dial 1588-7703','To contact the MapleStory Hotline, dial 1588-7703','o'),(7,10,'The EXP points needed to level up differ from different jobs.','All EXP points needed for the level-up is equal to that of other jobs.','x'),(7,11,'The EXP points awarded from the same monster differ from each time out.','The EXP points awarded will be the same, if it\'s from the same monster.','x'),(7,12,'The NPC that sells potions at Florina Beach is named \"Valen.\"','The NPC that sells potions there is \"Valen.\"','o'),(7,13,'You\'ll need EXP 15 to go from LV. 1 to LV. 2.','You\'ll need 15 points of EXP to go from LV 1 to LV 2.','o'),(7,14,'You\'ll need EXP 34 to go from LV. 2 to LV. 3.','You\'ll need 34 points of EXP for that.','o'),(7,15,'You\'ll need EXP 67 to go from LV. 3 to LV. 4.','You\'ll need 57 points of EXP for that.','x'),(7,16,'Any act of dealing/trading cash points will result in heavy punishment.','It\'s against the Terms of Agreement.','o'),(7,100,'You\'ll need EXP 92 to go from LV. 4 to LV. 5.','You\'ll need 92 points of EXP for that.','o'),(7,101,'You\'ll need EXP 250 to go from LV. 5 to LV. 6.','You\'ll need 135 points of EXP for that.','x'),(7,102,'You can only recharge your NexonCash through the MapleStory website or through the Cash Shop in the game.','It\'s impossible to recharge cash points at the website.','x'),(7,103,'If you delete a cash item, you\'ll receive 35% of it back through MaplePoints.','You only receive 30% of it back.','x'),(7,104,'All presents received through Cash Item cannot be deleted.','The only item that\'s undeletable is that of a \"use\" cash item.','x'),(7,105,'You can put upto 8 items of your liking at the wish list of the Cash Shop.','You can put upto 10 items on wish list.','x'),(7,106,'If you make the 2nd job adv. either at LV. 31 or beyond, you won\'t be able to receive the bonus SP + 1 that comes with the job adv.','You\'ll receive a bonus SP after every job adv. ','x'),(7,107,'You can buy presents for your friends using MaplePoints.','You can\'t buy presents for others with the MaplePoints.','x'),(7,108,'The Regular Sauna at Sleepywood Hotel costs 490 mesos.','The Regular Sauna costs 499 mesos to enter.','x'),(7,109,'You\'ll be able to choose either a sword, a bat, or an axe as your weapon when you first make the character. Out of those weapons, the axe is considered the strongest, and the slowest of the three.','The basic set of weapons you choose from when first creating the character may all look different, but they all consist of the same characteristics.','x'),(7,110,'MapleStory is a 2D side-scrolling online adventure game from Nexon.','MapleStory is a 2D side-scrolling online adventure game from Wizet.','x'),(7,111,'','','x'),(7,112,'','','o'),(7,113,'','','x'),(7,114,'','','o'),(7,115,'','','o'),(7,116,'','','x'),(7,117,'','','x'),(7,118,'','','o'),(7,119,'','','x'),(7,120,'','','x'),(7,121,'','','o'),(7,122,'','','o'),(7,123,'','','x'),(7,124,'','','x'),(7,125,'','','o'),(7,126,'','','x'),(7,127,'','','x'),(7,128,''